$(document).ready(function(){var picker=$(".selectpicker");var input=$("#inputQuery");picker.selectpicker();picker.on("change",function(e){searchLog(this.value)})});function searchLog(filter){var dump,div,a,i;dump=document.getElementById("logdump");console.log(filter);div=dump.getElementsByTagName("div");for(i=0;i<div.length;i++){a=div[i].getElementsByTagName("p")[0];if(a.innerHTML.toUpperCase().indexOf(filter)>-1){div[i].style.display=""}else{div[i].style.display="none"}}return false}function clearLogDump(){$("#logdump").empty();return false}
